import React, { Component } from 'react'
import LoginForm from './LoginForm'
import './App.css'
import { Switch } from 'react-router-dom'
class App extends Component {
  render() {
    <Switch>
      <Route path="/" component={LoginForm} />
    </Switch>
  }

}

export default App
